import React, { Component } from 'react';
import axios from 'axios';


const api = axios.create({
	baseURL: 'https://api.nytimes.com/svc/mostpopular/v2/viewed/1.json?api-key=mN6Xg33Uh049lVc0uwErmOgdhb4TYBt4'
})


class Articles extends React.Component {

state = {
	articles: [],
	testArray: [1, 4, 5, 9]
}

constructor(){
	super()
		api.get().then(res => {
		//console.log(res.data);
		this.setState({ articles: res.data.results})
		this.getArticle = this.getArticle.bind(this);
	})
}

getArticle(){

	const mediaArr = this.state.articles.map(function (media) { return media.media[0]; });
	const mediaMetadata = mediaArr.map(function (media) { return media.media[0]; });

    console.log(mediaMetadata);
	if (mediaArr.constructor == Array) {console.log("Array!")} else {console.log("Error")};
}

 render() {

    return (
<div className="Articles">
<h1>Articles page + {this.getArticle()}</h1>
{this.state.articles.map(function (article) {const a = article.title; return <h2>{a}</h2>})}
</div>
    );
}

}

export default Articles;



